import React from "react";
import Title from "../components/Title";

function Tendency(){
    return (
      <>
        <Title></Title>
        <h2>최초 성향 파악</h2>
        <p>Q. 어떤 여행을 좋아하시나요?</p>
        <p>Q. 소비 성향은?</p>
        <p>나중에 해야지 ~~~~</p>
      </>
    );
}

export default Tendency;
